import PropTypes from 'prop-types';
import Configuration from './Configuration/Configuration';
import NewConfiguration from './NewConfiguration/NewConfiguration';
import { useState } from 'react';
import EditConfiguration from './EditConfiguration/EditConfiguration';
import CreateConfigurationModal from './CreateConfigurationModal.js/CreateConfigurationModal';

import useModal from '../../hooks/useModal';
import useDrawer from '../../hooks/useDrawer';

const Configurations = props => {
    const [isVisibleEditDrawer, openEditDrawer, closeEditDrawer] = useDrawer();

    const [
        isVisibleNewConfigurationModal,
        showNewConfigurationModal,
        closeNewConfigurationModal,
        okNewConfigurationModal,
        cancelNewConfigurationModal,
    ] = useModal();

    return (
        <>
            <div className='px-6 py-10 flex flex-wrap gap-6'>
                <Configuration
                    title={'Configuration 1'}
                    text={"Today's New's Source, MGT"}
                    openEditDrawer={openEditDrawer}
                >
                    Nat config
                </Configuration>
                <Configuration title={'Configuration 2'} text={"Today's New's Source"} openEditDrawer={openEditDrawer}>
                    Nat config 2
                </Configuration>
                <Configuration title={'Configuration 2'} text={"Today's New's Source"} openEditDrawer={openEditDrawer}>
                    Nat config 2
                </Configuration>
                <NewConfiguration showNewConfigurationModal={showNewConfigurationModal} />
            </div>
            <EditConfiguration
                isVisibleEditDrawer={isVisibleEditDrawer}
                openEditDrawer={openEditDrawer}
                closeEditDrawer={closeEditDrawer}
            />
            <CreateConfigurationModal
                isVisibleNewConfigurationModal={isVisibleNewConfigurationModal}
                showNewConfigurationModal={showNewConfigurationModal}
                closeNewConfigurationModal={closeNewConfigurationModal}
                okNewConfigurationModal={okNewConfigurationModal}
                cancelNewConfigurationModal={cancelNewConfigurationModal}
            />
        </>
    );
};

Configurations.propTypes = {};

export default Configurations;
